"use strict";
var
  MessageFormat = require('message-format'),
  compile = function(msg) {
    return new MessageFormat('default', msg);
  };


module.exports = {
  id: 'default',
  LOCALIZATION_EXAMPLE_SIMPLE: compile('Some simple text'),
  LOCALIZATION_EXAMPLE_SIMPLE_FALLBACK: compile('Some fallback text'),
  LOCALIZATION_EXAMPLE_PLACEHOLDER: compile(''),
  LOCALIZATION_EXAMPLE_PLURALIZATION: compile(''),
  LOCALIZATION_EXAMPLE_CONTEXT: compile('')
};